import React, { useState, useEffect } from 'react';
import './plotPicker.css';

const levels = ['-1st floor', '-2nd floor', '-3rd floor'];

// Példa parkolóhelyek adatstruktúrája
const parkingData = {
  '-1st floor': [
    { id: 1, status: "occupied", size: "large" },
    { id: 2, status: "free", size: "medium" },
    { id: 3, status: "free", size: "small" },
    { id: 4, status: "occupied", size: "large" },
    { id: 5, status: "free", size: "medium" },
    { id: 6, status: "soon_free", size: "small" },
    { id: 7, status: "free", size: "large" },
    { id: 8, status: "occupied", size: "small" },
    { id: 9, status: "soon_free", size: "medium" },
    { id: 10, status: "free", size: "large" },
    { id: 11, status: "free", size: "medium" },
    { id: 12, status: "occupied", size: "small" },
    { id: 13, status: "soon_free", size: "large" },
    { id: 14, status: "free", size: "small" },
    { id: 15, status: "occupied", size: "medium" },
    { id: 16, status: "free", size: "large" },
    { id: 17, status: "soon_free", size: "medium" },
    { id: 18, status: "free", size: "small" },
    { id: 19, status: "occupied", size: "large" },
    { id: 20, status: "free", size: "medium" },
    { id: 21, status: "soon_free", size: "small" },
    { id: 22, status: "occupied", size: "large" },
    { id: 23, status: "free", size: "medium" },
    { id: 24, status: "occupied", size: "small" },
    { id: 25, status: "free", size: "large" },
    { id: 26, status: "soon_free", size: "medium" },
    { id: 27, status: "occupied", size: "small" },
    { id: 28, status: "free", size: "large" },
    { id: 29, status: "soon_free", size: "medium" },
    { id: 30, status: "free", size: "small" },
    // Add more spots as needed
  ],
  '-2nd floor': [
    { id: 31, status: 'free', size: 'large' },
    { id: 32, status: 'occupied', size: 'small' },
    // Add more spots as needed
  ],
  '-3rd floor': [
    { id: 33, status: 'soon_free', size: 'medium' },
    { id: 34, status: 'free', size: 'large' },
    // Add more spots as needed
  ],
};

function PlotPicker() {
  const [currentLevel, setCurrentLevel] = useState('-1st floor');
  const [carSize, setCarSize] = useState('medium'); // autó mérete

  const handleLevelChange = (level) => {
    setCurrentLevel(level);
  };

  const getSpotColor = (spot) => {
    if (spot.status === 'occupied') return 'red';
    if (spot.status === 'soon_free') return 'yellow';
    if (spot.status === 'free' && spot.size === carSize) return 'green';
    return 'gray';
  };

  const spots = parkingData[currentLevel];
  
  return (
    <div className="plot-picker-container">
      <h1>Pick a parking spot</h1>

      <div className="level-buttons">
        {levels.map((level) => (
          <button
            key={level}
            className={level === currentLevel ? 'active' : ''}
            onClick={() => handleLevelChange(level)}
          >
            {level}
          </button>
        ))}
      </div>

      <div className="parking-layout">
        {/* First 10 spots */}
        <div className="parking-container-top">
          {spots.slice(0, 10).map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Next 5 spots */}
        <div className="parking-container-left">
          {spots.slice(10, 15).map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Next 10 spots */}
        <div className="parking-container-bottom">
          {spots.slice(15, 25).reverse().map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Last 5 spots */}
        <div className="parking-container-right">
          {spots.slice(25, 30).reverse().map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>
        <div className="parking-container-middle">
          <div className='lift-base'>
            <div className='lift-top'></div>
            <div className='lift-bottom'></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default PlotPicker;
